import React from 'react';
import { Link } from 'react-router-dom';

class Home extends React.Component {
  render() {

    return(
      <nav className="navigator">
       <Link to="/works">Trabalhos</Link>
       <Link to="/contact">Contato</Link>
       <Link to="/about">Sobre</Link>
      </nav>
    );
  }
}

export default Home;
